import './Cursor.css';
import React, { useState, useEvent } from 'react';

function Cursor() {
    const [pos, setPos] = useState({ x: 200, y: 200 })
    return (
        <div className="Cursor"
            style={{ left: this.pos.x, top: this.pos.y }}>
        </div>
    );
}

export default Cursor;
